import React from "react";
import Header from "./Header";
import DetailImage from "./DetailImage";
import Info from "./Info";
import Footer from "./Footer";

const DetailLayoutStyle = {
  margin: 0,
  background: "beige",
  fontFamily: "YuMincho",
  letterSpacing: 3,
  fontWeight: 300,
  fontColor: "lightgray",
};

export default function WineDetailLayout({
  name,
  category,
  taste,
  producer,
  home,
  price,
  url,
}) {
  <div style={DetailLayoutStyle}>
    <Header />
    <DetailImage />
    <Info
      name={name}
      category={category}
      taste={taste}
      producer={producer}
      home={home}
      price={price}
      url={url}
    />
    <Footer />
  </div>;
}
